    MOD = 1000000008
    if k == 0:
        return 1
    if k == 1:
        return len(n) - 1

    def c(n, m):
        if n < m * 2:
            m = n - m
        if 0 <= m:
            if (n, m) not in cache:
                cache[n, m] = (c(n - 1, m - 1) + c(n - 1, m)) % MOD
            return cache[n, m]
        return 0
    tais = [len(n) - i - 1 for (i, c) in enumerate(n) if c == '1']
    tlen = len(tais)
    cache = {(0, 0): 1}
    res = 0
    for m in range(len(n), 0, -1):
        (x, t) = (m, k)
        while x != 1:
            y = 0
            t -= 1
            while x:
                y += x & 1
                x //= 2
            x = y
        if t == 1:
            if len(tais) > m:
                del tais[m:]
            res += sum((c(t, m - i) for (i, t) in enumerate(tais))) + (m <= tlen)
    return res % MOD

